服务需求描述：
1. 负责对标头部厂商软件研发领域大模型、智能研发助手等AI应用能力，定期输出对标分析报告;
2. 根据对标结果，结合智家研发助手及智能服务能力，对提示词、知识库等进行优化和润色;
3. 根据对标情况，结合平台工具能力，提出软件研发全生命周期AI自动任务可行性分析报告;
4. 对需求、代码、文档等软件研发数据资产进行统计、分析、标注，并提取高质量数据集，让大模型学习，提升输出效果;
5. 负责采集AI对话数据，对大模型相关数据进行整理、分析、归纳，对模型输出的多轮对话结果评测，统计评分。

服务方案要求：
1. 3年及以上数据分析/挖掘及相关开发工作经验;
2. 熟练掌握一门或多门编程语言（不限于Java/python/C/C++）;
3. 良好的数据敏感度，有数据标注、分析、挖掘、清洗和建模的经验;
4. 对AI技术感兴趣，关注过一些比较有名的AI语言模型，了解基础的原理。
5. 有强烈的责任心和自我驱动力，愿意不断学习和探索新技术。
6. 具备优秀的团队合作精神和沟通能力，能够在快节奏的工作环境中高效解决问题。

具有以下条件者优先：
1. 有提示词工程、提示词优化等相关工作经验者优先；
2. 有向量化知识库、知识助手建设等相关工作经验者优先。
